import Link from "next/link";

const PodcastList = ({ audioClips, setOpenPodcast }) => {
  return (
    audioClips.map( clip => (
        <a href={`/podcast/${clip.id}`} onClick={e => setOpenPodcast(e, clip)}> { clip.title } </a>

    ))
  )
}

export default PodcastList;
